<title>shelfdoc - Consulting Solutions for FBA Expired Goods</title>
<style>
  :root{
    --bg-solid:#1b2212;
    --text:#ffffff;
    --text-soft:rgba(255,255,255,.92);
  }
  html,body{height:100%;}
  body{
    margin:0; color:var(--text);
    background: var(--bg-solid);
    font-family: ui-rounded, "SF Pro Rounded", "Avenir Next Rounded",
                 "Nunito", "Quicksand",
                 ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial, sans-serif;
    -webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;
  }
  .container{ max-width:1100px; margin:0 auto; padding:0 24px; }

  header{
    position:sticky; top:0; z-index:20;
    background: var(--bg-solid);
    border-bottom: 1px solid rgba(255,255,255,.08);
  }
  .nav{ height:92px; display:flex; align-items:center; justify-content:space-between; }
  .brand{ text-decoration:none; color:var(--text); font-weight:900; letter-spacing:-.02em; font-size:28px; line-height:1; display:inline-block; }
  @media (min-width:768px){ .brand{ font-size:32px; } }
  .cta{ display:inline-flex; align-items:center; justify-content:center; padding:10px 16px; font-weight:700; font-size:15px; color:var(--text);
    text-decoration:none; background: rgba(255,255,255,.10); border:1px solid rgba(255,255,255,.22); border-radius:14px; transition:.2s ease; }
  .cta:hover{ background:rgba(255,255,255,.16); }

  main{ position:relative; }
  .hero{ min-height:calc(100vh - 92px - 72px); display:grid; place-items:center; text-align:center; padding:72px 0; }
  h1.hero-title{ margin:0; font-weight:850; line-height:1.03; letter-spacing:-.02em; text-wrap:balance; }
  .hero-title{ font-size:36px; }
  @media (min-width:640px){ .hero-title{ font-size:60px; } }
  @media (min-width:1100px){ .hero-title{ font-size:84px; } }
  .line1{ display:block; }
  .line2{ display:flex; gap:12px; justify-content:center; align-items:baseline; margin-top:10px; flex-wrap:wrap; }
  .focus{ font-weight:900; letter-spacing:-.012em; }

  p.sub{
    margin:20px auto 0;
    max-width:820px;
    font-weight:750;
    letter-spacing:-.005em;
    font-size:clamp(1.05rem, 1.9vw, 1.35rem);
    line-height:1.6;
    color:var(--text-soft);
    text-wrap:balance;
  }

  .feature{ margin:26px auto 0; display:flex; justify-content:center; }
  .feature .frame{
    width:min(100%, 1120px);
    aspect-ratio:21 / 10;
    overflow:hidden;
    border-radius:18px;
    border:none;
    box-shadow: 0 8px 20px rgba(0,0,0,.22);
    background: var(--bg-solid);
  }
  .feature .frame img{
    width:100%; height:100%;
    object-fit:cover;
    object-position:50% 52%;
    display:block;
  }

  footer{ border-top:1px solid rgba(255,255,255,.08); background: var(--bg-solid); }
  .foot{ display:flex; align-items:center; justify-content:space-between; gap:16px; padding:20px 0; color:rgba(255,255,255,.85); font-size:14px; }
  .link{ color:inherit; text-underline-offset:2px; }
</style>
